export const AjouterAction=(pays)=>{
    return {type:'AjouterActionPAY',payload:pays}
};

export const ModifierAction=(ModPup)=>{
    return {type:'ModifierAction_PUPLATION',payload:ModPup}
};

export const SupprimierAction=(idPup)=>{
    return {type:'SUPREMIER_PUPLATION',payload:idPup}
};
